import React from 'react'
import Head from 'next/head'

interface Props {
    children?: React.ReactNode
}

export const Layout: React.FC<Props> = ({children}) => {
    return (
        <React.Fragment>
            <Head>
                <title>
                    Next js Website Man
                </title>
          </Head>
          {children}
        </React.Fragment>
    )
}
